import "./Footer.css";
import logoInstagram from "./akar-icons_instagram-fill.png";
const Footer = () => {
  return (
    <footer>
      <span>IMAGEN</span>
      <ul className="footer-phone">
        <li>Llamada importante 1</li>
        <li>Llamada importante 1</li>
        <li>Llamada importante 1</li>
        <li>Llamada importante 1</li>
      </ul>
      <ul className="footer-img">
        <li>
          <img src={logoInstagram} alt="facebook" />
        </li>
        <li></li>
        <li></li>
      </ul>
    </footer>
  );
};

export default Footer;
